import React, {Component, Fragment} from "react";
import Background from "../backgroundComponent/Background";
import Header from "../headerComponent/Header";
import Area from "../areaComponent/Area";
import { interpolate } from "flubber" // ES6
var flubber = require("flubber"); // Node classic

var start = "M0 1080L604.83 1080L1920 1080L1920 0L1368.9 0L0 0L0 1080Z",
    end   = "M0 1080L518.75 1080L917.64 540L1164.84 426.45L1468.22 0L0 0L0 1080Z"

var interpolator = flubber.interpolate(start, end);

d3.select("path")
    .transition()
    .attrTween("d", function(){ return interpolator; });

class StartAnimation extends Component{

    render(){
        return(
            <div className="hello">
                Hello
            </div>
        );
    }
}



